import React from 'react';
import history from '../history';
import {Link} from 'react-router-dom';

class SplashEmail extends React.Component {
	render() {
		return(
			<form className="gridSingleVert">
				<label className="white marginBottomHalf">Email Address</label>
				<input className="splashInput roundedCorners marginBottom" type="email" placeholder="Email*" />
				<input className="primaryButton roundedCorners marginBottom" type="submit" value="Join Us" />
				<Link to="/">
					<button className=" secondaryButton roundedCorners">Continue to Site</button>
				</Link>
			</form>
		);
	}
}

export default SplashEmail;
